    console.log(no_of_like);
    return (
      <div>
        {likes.map((like) => (
          <div>
            <a onClick={this.LikeInfo(like.id)} className="button">
              {no_of_like}
            </a>
            {/* <a className="button mt-1">{no_of_comment}</a> */}
          </div>
        ))}
      </div>
    );
  }
}

